import { FC } from "react";
import CustomModal from "shared/modal/modal";

interface IProps {
  handlePopup: () => void;
}
const SearchPopUp: FC<IProps> = ({ handlePopup }) => {
  return (
    <div>
      <CustomModal show={true} className="info-popup">
        <div className="info-wrapper display-flex-center flex--column">
          <h2 className="no--margin mt--25 mb--25 font-size--30 font--medium line-height--24">
            How to use
          </h2>
          <p className="font-size--xxl font--regular line-height--43 text--center">
            SoundMind allows you to customize your music therapy experience.
            When presented with a music selection, you can swipe toward the
            center icon if you like it, and swipe away from the center icon on
            pieces you dislike. You can also like different soundscapes
            depending on your personal taste. This allows us to create a custom
            mental health profile to best suit you.
          </p>
          <button
            className="width--full mt--40 font-size--24 font--medium line-height--34"
            onClick={() => handlePopup()}
          >
            Done
          </button>
        </div>
      </CustomModal>
    </div>
  );
};

export default SearchPopUp;
